pub enum HandleMsg {
    Receive(Cw20ReceiveMsg),
    UnstageAsset {
        asset: HumanAddr,
        amount: Uint128,
    },
    ResetTarget {
        target: Vec<u32>,
    },
    Mint {
        /// Asset amounts deposited for minting
        asset_amounts: Vec<Uint128>,
        /// Minimum tokens to receive
        min_tokens: Option<Uint128>,
    },
}

pub enum Cw20HookMsg {
    StageAsset {
        asset: HumanAddr,
        amount: Uint128,
    },
    Burn {
        num_tokens: Uint128,
        asset_weights: Option<Vec<u32>>,
    },
}
